import React from 'react';

export default function NavBar() {
  return (
    <div className='container'>
      <nav className="navbar navbar-expand-lg py-3 navbar-light bg-light">
        <div className='row w-100'>
          {/* Sol Taraftaki İçerik */}
          <div className='col-md-6'>
            <a className="navbar-brand" href="#">Navbar</a>
            <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
              <span className="navbar-toggler-icon"></span>
            </button>
          </div>

          {/* Sağ Taraftaki İçerik */}
          <div className='col-md-6'>
            <div className="collapse navbar-collapse border border-danger" id="navbarSupportedContent">
              <ul className="navbar-nav ml-auto">
                <li className="nav-item">
                  <a className="nav-link" href="#">Hizmetler</a>
                </li>
                {/* Diğer <li> öğeleri */}
              </ul>
            </div>
          </div>
        </div>
      </nav>
    </div>
  );
}
